import { useSelector } from "react-redux"
import { useEffect } from "react"
import { useNavigate } from "react-router-dom"

const Home = () => {

    const user = useSelector(state => state.user)

    useEffect(() => {
        if (!user) {
            navigate('/')
        }
    }, [user])
    return (
        <>
        <h1>Home Page</h1>
        </>
    )
}

export default Home
